import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';

import Navigation from './pages/about';
import About from './pages/contact';
import Contact from './pages/error';
import Login from './pages/homepage';
import Profile from './pages/quizPage';
import ProfileWelcome from './pages/quizStart';
import RecipeSearch from './pages/resources';
import SignUp from './pages/results';

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <div>
        < Navigation />
        <Switch>
          <Route path='/' component={SignUp} exact/>
          <Route path='/about' component={About} />
          <Route path='/contact' component={Contact} />
          <Route path='/login' component={Login} />
          <Route path='/profile' component={Profile} />
          <Route path='/profilewelcome' component={ProfileWelcome} />
          <Route path='/recipesearch' component={RecipeSearch} />
          <Route path='/signup' component={SignUp} />
          <Route component={Error} />
        </Switch>
        </div>
      </BrowserRouter>

    );
  }
}

export default App;
